.account-container{
  background-color: #ffffff;
  height: 450px;
  border-radius: 4px;
  padding: 40px 50px;

  .account-form{
    width: 300px;
    float: left;

    .account-btn{
      margin-top: 50px;
      display: flex;

      & button:nth-child(1){
        margin: 0 auto;
      }
    }
  }

  .photo{
    width: 200px;
    float: left;
    margin-left: 30px;

    .avatar-uploader .el-upload {
      border: 1px dashed #d9d9d9;
      border-radius: 6px;
      cursor: pointer;
      position: relative;
      overflow: hidden;
    }
    .avatar-uploader .el-upload:hover {
      border-color: #3F6AFF;
    }
    .avatar-uploader-icon {
      font-size: 28px;
      color: #8c939d;
      width: 178px;
      height: 178px;
      line-height: 178px;
      text-align: center;
    }
    .avatar {
      width: 178px;
      height: 178px;
      display: block;
    }
  }
}
